import ReactDOM from 'react-dom';
import './index.css';
import Heading from './heading';
import Body from './body';
import List from './list';

ReactDOM.render(
  <React.StrictMode>
      <Heading/>
      <Body/>
      <List/>   
  </React.StrictMode>,
  document.getElementById('root')
